import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name:'Linda',
          id:'323123a'
        },
        {
          name: 'Frank',
          id:'3223a'
        },
        {
          name:'Jacky',
          id:'323121233a'
        },
        {
          name:'Andrei',
          id:'34sfa23a'
        }
      ]

    }
  }


  render (){ 
    return  <div className="App">
      {
        this.state.monsters.map((monster) => { 
          return (
          <div key={monster.id}>
            <h1>{monster.name}</h1>
          </div>
          )
        })
      }
    </div>
}

}


export default App;
